package com.mycompany.gofarm.product.dto;

import java.util.Date;

public class DealDTO {

	private int de_code;
	private int prod_code;
	private Date de_date;
	private int de_cnt;
	private int de_usercode;
	
	public DealDTO() {
		// TODO Auto-generated constructor stub
	}

	public int getDe_code() {
		return de_code;
	}

	public void setDe_code(int de_code) {
		this.de_code = de_code;
	}

	public int getProd_code() {
		return prod_code;
	}

	public void setProd_code(int prod_code) {
		this.prod_code = prod_code;
	}

	public Date getDe_date() {
		return de_date;
	}

	public void setDe_date(Date de_date) {
		this.de_date = de_date;
	}

	public int getDe_cnt() {
		return de_cnt;
	}

	public void setDe_cnt(int de_cnt) {
		this.de_cnt = de_cnt;
	}

	public int getDe_usercode() {
		return de_usercode;
	}

	public void setDe_usercode(int de_usercode) {
		this.de_usercode = de_usercode;
	}
	
	
	
	
	
	
	
	
}
